import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="backgroundImage">
      <h3 className="musicTitle">Music</h3>
      <h3 className="artTitle">Art</h3>
      <h3 className="clothTit">Cloth</h3>
      <h3>Social</h3>
    </div>
  );
}

export default App;
